import React from "react";
import Header from "../Header";
import Jumbo from "../Jumbo/Jumbo";
import Activity from "../Activity"

import "./App.css";
import Directions from "../Directions";

const App = () => {
  return (
    <div className="App">
      <Header />
      <Jumbo />
      <Activity />
      <Directions />
    </div>
  );
};

export default App;
